func StarDataByHR(hr int) (StarData, error) {
	if len(stardat) == 0 {
		err := LoadStarData()
		if err != nil {
			return StarData{}, err
		}
	}
	if hr > len(stardat) {
		return StarData{}, errors.New("no such star")
	}
	data, err := parseStarData(stardat[hr-1])
	return StarData{starData: data}, err
}
